import React from 'react';

const List = () => {
  return (
    <ol>
      <li>Hello</li>
      <span className='list_btn'>
        <CheckIcon className='ch_btn btn' />
        <DeleteIcon className='del_btn btn' />
      </span>
    </ol>
  );
};

export default List;
